import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Nav() {
  const navStyle = {
    color: 'white'
  };


  return (

    <nav>
    <img src="/src/Icons/icons8-sakura-96.png" className="App-logo" alt="logo" />
      <link rel="stylesheet" href="/src/Icons/icons8-sakura-96.png" />
      <ul className="nav-links">
        <Link style={navStyle} to='/graphs'>
        <li>Graphs</li>
        </Link>
        <Link style={navStyle} to='/map'>
        <li>Map</li>
        </Link>
      </ul>
    </nav>
  );
}
export default Nav;
